import React from 'react';
import { Link } from 'react-router-dom';

import './Image.css';

const Imgage = props => {
	if (props.href) {
		return <a href={props.href}>{props.children}</a>;
	}
	if (props.to) {
		return (
			<Link to={props.to} exact={props.exact}>
				{props.children}
			</Link>
		);
	}
	return (
		<img type={props.type} onClick={props.onClick}>
			{props.children}
		</img>
	);
};

export default Image;
